        private Bitmap Base64StringToImage(string inputStr)
        {
            try
            {
                inputStr = inputStr.Replace("data:image/png;base64,", "").Replace("data:image/jgp;base64,", "").Replace("data:image/jpg;base64,", "").Replace("data:image/jpeg;base64,", "");
                Bitmap bitmap = new Bitmap(new MemoryStream(Convert.FromBase64String(inputStr)));
                MemoryStream stream1 = new MemoryStream(Convert.FromBase64String(inputStr));
                stream1.Close();
                return bitmap;
            }
            catch (Exception exception)
            {
                MessageBox.Show("Base64StringToImage 转换失败/nException：" + exception.Message);
                return null;
            }
        }

        public void CreateQR(string strCode)
        {
            ImageSource source = Imaging.CreateBitmapSourceFromHBitmap(new QRCode(new QRCodeGenerator().CreateQrCode(strCode, QRCodeGenerator.ECCLevel.Q, false, false, QRCodeGenerator.EciMode.Default, -1)).GetGraphic(5, System.Drawing.Color.Black, System.Drawing.Color.White, null, 15, 6, false).GetHbitmap(), IntPtr.Zero, Int32Rect.Empty, BitmapSizeOptions.FromEmptyOptions());
            this.QrCodeContainer.Source = source;
        }

        public void CreateQRWx(string strCode)
        {
            string inputStr = "data:image/jpeg;base64,";
            ImageSource source = Imaging.CreateBitmapSourceFromHBitmap(this.Base64StringToImage(inputStr).GetHbitmap(), IntPtr.Zero, Int32Rect.Empty, BitmapSizeOptions.FromEmptyOptions());
            this.QrCodeContainerWx.Source = source;
        }

