        private void displayTimerStart(bool closeAutoUpdate = false)
        {
            if (closeAutoUpdate)
            {
                Console.WriteLine("displayTimerStart autoUpdate 已经启动 关闭");
                if (this.stopAutoUpdate())
                {
                    Console.WriteLine("displayTimerStart autoUpdate 已经关闭");
                }
            }
            else if (!this.IsProcessOpen("autoUpdate"))
            {
                this.startAutoUpdate("displayTimerStart");
            }
            else
            {
                Console.WriteLine("displayTimerStart autoUpdate 已经启动 重新启动");
                if (this.stopAutoUpdate())
                {
                    this.startAutoUpdate("displayTimerStart");
                }
            }
            this.displayTimer.Start();
        }

