        public bool IsProcessOpen(string name)
        {
            Process[] processes = Process.GetProcesses();
            for (int i = 0; i < processes.Length; i++)
            {
                if (processes[i].ProcessName.Contains(name))
                {
                    return true;
                }
            }
            return false;
        }

