        private void startAutoUpdate(string from = "DisplayTimer_Tick")
        {
            if (!this.IsProcessOpen("autoUpdate"))
            {
                Console.WriteLine(from + " autoUpdate 启动开始");
                if (!Directory.Exists(pathParent + "autoUpdate"))
                {
                    Console.WriteLine(from + " autoUpdate 启动失败,文件夹不存在");
                }
                else if (File.Exists(pathParent + @"autoUpdate\autoUpdate.exe"))
                {
                    if (this.startExe(pathParent + @"autoUpdate\autoUpdate.exe", pathParent + "autoUpdate"))
                    {
                        Console.WriteLine(from + " autoUpdate 启动成功");
                    }
                    else
                    {
                        Console.WriteLine(from + " autoUpdate 启动失败");
                    }
                }
            }
        }

        public bool startExe(string exePath, string exePathParent)
        {
            Process process1 = new Process();
            process1.StartInfo.FileName = exePath;
            process1.StartInfo.Arguments = "";
            process1.StartInfo.UseShellExecute = false;
            process1.StartInfo.RedirectStandardInput = true;
            process1.StartInfo.RedirectStandardOutput = true;
            process1.StartInfo.RedirectStandardError = true;
            process1.StartInfo.CreateNoWindow = true;
            process1.StartInfo.WorkingDirectory = exePathParent;
            process1.Start();
            return true;
        }

        private bool stopAutoUpdate() => 
            new CommonUtil().CloseProcess("autoUpdate");

        [DebuggerNonUserCode, GeneratedCode("PresentationBuildTasks", "4.0.0.0"), EditorBrowsable(EditorBrowsableState.Never)]
        void IComponentConnector.Connect(int connectionId, object target)
        {
            switch (connectionId)
            {
                case 1:
                    ((Task) target).Loaded += new RoutedEventHandler(this.TaskView_Loaded);
                    return;

                case 2:
                    this.TaskContainer = (Grid) target;
                    return;

                case 3:
                    this.QrCodeContainerWx = (System.Windows.Controls.Image) target;
                    return;

                case 4:
                    this.QrCodeContainer = (System.Windows.Controls.Image) target;
                    return;
            }
            this._contentLoaded = true;
        }

        private void TaskContainerChange(UserControl view)
        {
            this.TaskContainer.Children.Clear();
            this.TaskContainer.Children.Add(view);
        }

        private void taskFinished(string task_id, string baseURL, string download_path)
        {
            HttpUtils.Get(baseURL + "/order/taskFinished/?taskID=" + task_id, "1");
            if (File.Exists(download_path))
            {
                try
                {
                    this.log.Info("taskFinished 删除同名文件:" + download_path);
                    this.log.Debug("taskFinished 删除同名文件:" + download_path);
                    File.Delete(download_path);
                }
                catch (Exception exception)
                {
                    Console.WriteLine("taskFinished catch Exception:" + exception.Message);
                }
            }
        }

        private void TaskView_Loaded(object sender, RoutedEventArgs e)
        {
            string machineCode = MicroPrinter.App.AppContext.Instance.MachineCode;
            this.CreateQR(machineCode);
            this.CreateQRWx(machineCode);
            this.noTask = new NoTask();
            this.inTask = new InTask();
            this.TaskContainerChange(this.noTask);
        }
